// SPDX-License-Identifier: MIT
pragma solidity ^0.8.11;

import "@openzeppelin/contracts/token/ERC721/extensions/ERC721URIStorage.sol";
import "@openzeppelin/contracts/utils/Counters.sol";
import "@openzeppelin/contracts/utils/math/SafeMath.sol";
import "@openzeppelin/contracts/access/Ownable.sol";

contract NFTMarket is ERC721URIStorage, Ownable {
    using Counters for Counters.Counter;
    using SafeMath for uint256;
    Counters.Counter private _tokenIDs;
    //mapping(uint256 => NFTListing) private _listings;
    // this package inspired from youtube Abdou Ouahib
    //https://www.youtube.com/watch?v=e7p6-e96ZWo&list=PLClcacTLMggPDj8g7vfxZeW6F9gB1VDhA&index=11
    // if tokenURI is not an empty string => an NFT was created
    // if price is not 0 => an NFT was listed
    // if price is 0 && tokenURI is an empty string => NFT was transferred (either bought, or the listing was canceled)
    //eventlerde loop yapıp
    event NFTTransfer(
        uint256 tokenID,
        address from,
        address to,
        string tokenURI,
        uint256 price
    );

    struct NFTListing {
        uint256 tokenID;
        uint256 price;
        address seller;
        string tokenURI;
    }

    mapping(uint256 => uint256) private tokenIdToIndex;

    NFTListing[] public nftList;

    constructor() ERC721("Dogus NFTs", "DNFT") {}

    function createNFT(string calldata tokenURI) external {
        _tokenIDs.increment();
     //   _tokenIDs.increment();
     //   _tokenIDs.increment();
        require(bytes(tokenURI).length>25,"Wrong TokenUri");
        require(checkTokenUri(tokenURI)==0,"Already Minted");
        uint256 currentID = _tokenIDs.current();
        _safeMint(msg.sender, currentID);
        _setTokenURI(currentID, tokenURI);
        //_listings[tokenID] = NFTListing(0, msg.sender);

        nftList.push(NFTListing(currentID, 0, msg.sender, tokenURI));
        tokenIdToIndex[currentID] = nftList.length - 1;
        emit NFTTransfer(currentID, address(0), msg.sender, tokenURI, 0);
    }

    function listNFT(uint256 _tokenID, uint256 _price) external {
         require(_price >=0, "Cannot negative");    
        if (_price == 0)
        {
             cancelListing(_tokenID);
        }
        else {

        require(nftList[tokenIdToIndex[_tokenID]].seller == msg.sender, "You Are not owner");    

        if (nftList[tokenIdToIndex[_tokenID]].price==0){   
        transferFrom(msg.sender, address(this), _tokenID);
        //approve(address(this), _tokenID);
        //_transfer(msg.sender, address(this), _tokenID);
        nftList[tokenIdToIndex[_tokenID]].price = _price;
        emit NFTTransfer(_tokenID, msg.sender, address(this), "", _price);
        }
        else
        {        
        nftList[tokenIdToIndex[_tokenID]].price = _price;
        }
        }
    }


    /*  function strlen(string memory s) internal pure returns (uint256) {
        uint256 len;
        uint256 i = 0;
        uint256 bytelength = bytes(s).length;
        for (len = 0; i < bytelength; len++) {
