            } else if (b < 0xF8) {
                i += 4;
            } else if (b < 0xFC) {
                i += 5;
            } else {
                i += 6;
            }
        }
        return len;
    }*/

    /*function _beforeTokenTransfer(
        address from,
        address to,
        uint256 tokenId
    ) internal override {
        require(msg.sender!=address(this), "nft contract cannot transfer");
    }*/

    function buyNFT(uint256 _tokenID) external payable {
        NFTListing memory listing = nftList[tokenIdToIndex[_tokenID]];
        require(listing.price > 0, "NFTMarket: nft not listed for sale");
        require(msg.value == listing.price, "NFTMarket: incorrect price");
        require(listing.seller != msg.sender, "You cannot buy your NFTs");
        nftList[tokenIdToIndex[_tokenID]].seller = msg.sender;
        nftList[tokenIdToIndex[_tokenID]].price = 0;
        ERC721(address(this)).transferFrom(address(this), msg.sender, _tokenID);
        approve(address(this), _tokenID);
        //true falseluya çevir

        //payable(listing.seller).transfer(listing.price.mul(95).div(100)); //95ler carp 100 e böl
         (bool sent, bytes memory data) = payable(listing.seller).call{
                value: listing.price.mul(95).div(100)
            }("");
        require(sent, "Failed to send Ether");
        emit NFTTransfer(_tokenID, address(this), msg.sender, "", 0);
    }

    function cancelListing(uint256 _tokenID) internal {
        NFTListing memory listing = nftList[tokenIdToIndex[_tokenID]];
        require(listing.price > 0, "NFTMarket: nft not listed for sale");
        require(
            listing.seller == msg.sender,
            "NFTMarket: you're not the seller"
        );
        nftList[tokenIdToIndex[_tokenID]].price = 0;
        //ERC721(address(this)).transferFrom(address(this), msg.sender, _tokenID);
        ERC721(address(this)).transferFrom(address(this), msg.sender, _tokenID);
        approve(address(this), _tokenID);

        emit NFTTransfer(_tokenID, address(this), msg.sender, "", 0);
    }

    function withdrawFunds() public onlyOwner {
        uint256 balance = address(this).balance;
        require(balance > 0, "NFTMarket: balance is zero");
        payable(msg.sender).transfer(balance);
    }

    function myNFTs(address _sender)
        external
        view
        returns (NFTListing[] memory)
    {
        //address[] memory tokenList;
        uint256 jj;
        for (uint256 ii = 0; ii < nftList.length; ii++) {
            if (nftList[ii].seller == _sender) {
                jj++;
            }
        }

        uint256 count = jj;

        uint256 j;

        NFTListing[] memory nftListMem = new NFTListing[](count);

        // An array of 'Todo' struc

        for (uint256 i = 0; i < nftList.length; i++) {
            if (nftList[i].seller == _sender) {
                nftListMem[j] = nftList[i];
                j++;
            }
        }
        return nftListMem;
    }

   /*function allNFTs()
        external
        view
        returns (NFTListing[] memory)
    {
        return nftList;
    }
   */


    function allNFTs()
        external
        view
        returns (NFTListing[] memory)    {
        //address[] memory tokenList;     

        uint256 count = nftList.length;

        uint256 j;

        NFTListing[] memory nftListMem = new NFTListing[](count);



        for (uint256 i = 0; i < nftList.length; i++) {

                nftListMem[j] = nftList[i];
                j++;

        }
        return nftListMem;
    }


     function checkTokenUri(string calldata _tokenURI) internal view returns (uint256) {
        //address[] memory tokenList;
        for (uint256 ii = 0; ii < nftList.length; ii++) {

       if (bytes(nftList[ii].tokenURI).length == bytes(_tokenURI).length) {
               if( keccak256(abi.encodePacked(nftList[ii].tokenURI))==keccak256(abi.encodePacked(_tokenURI)) )
               {
                return 1;                
               }
            }

        }
         return 0;
     }

    function onSellNFTs() external view returns (NFTListing[] memory) {
        //address[] memory tokenList;
        uint256 jj;
        for (uint256 ii = 0; ii < nftList.length; ii++) {
            if (nftList[ii].price > 0) {
                jj++;
            }
        }

        uint256 count = jj;

        uint256 j;

        NFTListing[] memory nftListMem = new NFTListing[](count);

        // An array of 'Todo' struc

        for (uint256 i = 0; i < nftList.length; i++) {
            if (nftList[i].price > 0) {
                nftListMem[j] = nftList[i];
                j++;
            }
        }
        return nftListMem;
    }

    /*






    function clearListing(uint256 tokenID) private {
        _listings[tokenID].price = 0;
        _listings[tokenID].seller = address(0);
    } */
}
